import React from 'react';
import './page.scss';
import Header from './../header/header';
import { Outlet } from 'react-router-dom';
import Footer from './../footer/footer';

const Page = (): JSX.Element => {
    return (
        <div className="page">
            <Header/>
            <Outlet/>
            <Footer/>
        </div>
    );
}

export default Page;
